class TestGetUsdPriceForCoins(SimpleTestCase):

    def test_get_usdt_rates_for(self):
        if LIVE_TESTING:
            rates = get_usdt_rates_for('BTC', 'ETH', 'USDT')
        else:
            rates = {'BTC': 8158.02, 'ETH': 524.563, 'USDT': 1.0}

        self.assertTrue('ETH' in rates)
        self.assertTrue('BTC' in rates)
        self.assertTrue('USDT' in rates)
 
        self.assertTrue(isinstance(rates['BTC'], float))

        self.assertEqual(rates['USDT'], 1)
        self.assertGreater(rates['BTC'], 1000)
        self.assertGreater(rates['BTC'], rates['ETH'])
    
class TestTickers(SimpleTestCase):
    "Testing tickers functions"

    def setUp(self):
        self.poloniex_tickers = POLONIEX_TICKERS
        self.bittrex_tickers = BITTREX_TICKERS
        self.rates = {'BTC': 8158.02, 'ETH': 524.563, 'USDT': 1.0}
        self.poloniex = Tickers('poloniex')
        self.poloniex.tickers = self.poloniex_tickers
        self.poloniex.run()

        self.tickers = Tickers('poloniex')
        if LIVE_TESTING:
            self.tickers.run() # enable for live testing
        else:
            self.tickers.tickers = self.poloniex_tickers
            self.tickers.run()

    def test_tickers_has_symbol(self):
        tickers = self.poloniex
        self.assertTrue(tickers.tickers_has_symbol('BTC/USDT'))
        self.assertTrue(tickers.tickers_has_symbol('OMG/ETH'))
        self.assertFalse(tickers.tickers_has_symbol('BTCX/USDT'))
        self.assertFalse(tickers.tickers_has_symbol('BTC/ETHX'))

    def test_symbols_info_has_symbol(self):
        tickers = self.poloniex
        self.assertTrue(tickers.symbols_info_has_symbol('BTC/USDT'))
        self.assertTrue(tickers.symbols_info_has_symbol('OMG/ETH'))
        self.assertFalse(tickers.symbols_info_has_symbol('BTCX/USDT'))
        self.assertFalse(tickers.symbols_info_has_symbol('BTC/ETHX'))

    def test_tickers(self):
        self.assertGreater(len(self.tickers.tickers), 80)
        self.assertGreater(len(self.tickers.symbols_info), 80*2) # 2 for each coin (price/volume)
        
        self.assertTrue(set(['BTC/USDT', 'ETH/USDT', 'ETH/BTC']).issubset(self.tickers.tickers.keys()))
        self.assertFalse(set(['BTC/XXX', 'XXX/USDT']).issubset(self.tickers.tickers.keys()))

        btc_usdt = self.tickers.tickers['BTC/USDT']
        self.assertTrue(set(['symbol', 'timestamp', 'close', 'quoteVolume']).issubset(btc_usdt.keys()))
        self.assertEqual(btc_usdt['symbol'], 'BTC/USDT')
        self.assertGreater(btc_usdt['close'], 100)
        self.assertGreater(btc_usdt['quoteVolume'], 1000)
        self.assertGreater(btc_usdt['timestamp'], 1523439350000)

    def test_standard_format_for_symbols_info(self):
        tickers = self.poloniex

        price_eth_btc = next(item for item in tickers.symbols_info if item['symbol']=='ETH/BTC' and item['category']=='price')
        self.assertTrue(set(['source', 'category', 'symbol', 'value', 'timestamp']).issubset(price_eth_btc.keys()))
        self.assertEqual(price_eth_btc, {'source': 'poloniex', 'category': 'price', 'symbol': 'ETH/BTC', 'value': 0.0608198, 'timestamp': 1523439353.598})
        self.assertEqual(price_eth_btc['value'], 0.0608198)

        volume_btc_usdt = next(item for item in tickers.symbols_info if item['symbol']=='BTC/USDT' and item['category']=='volume')
        self.assertTrue(set(['source', 'category', 'symbol', 'value', 'timestamp']).issubset(volume_btc_usdt.keys()))
        self.assertEqual(volume_btc_usdt['value'], 1107.10190929)

    def test_standard_format_for_symbol_info_bittrex_price(self):
        tickers = Tickers('bittrex')
        tickers.tickers = self.poloniex_tickers
        tickers.run()

        price_game_btc = next(item for item in tickers.symbols_info if item['symbol']=='GAME/BTC' and item['category']=='price')
        self.assertEqual(price_game_btc, {'source': 'bittrex', 'category': 'price', 'symbol': 'GAME/BTC', 'value': 0.00017264, 'timestamp': 1523439353.596})

    def test_symbols_allowed(self):
        tickers = Tickers('bittrex')
        tickers.tickers = self.bittrex_tickers

        #print(tickers.tickers)

        # test counter_currency
        symbol_na = tickers.tickers['2GIVE/XXX']
        self.assertFalse(Tickers._symbol_allowed(symbol_na))

        for pair in ('BTC/USDT', 'DASH/BTC', 'XRP/ETH', 'ETH/BTC'):
            symbol = tickers.tickers[pair]
            self.assertTrue(Tickers._symbol_allowed(symbol))

        usdt_rates = {'BTC': 8158.02, 'ETH': 524.563, 'USDT': 1.0}
        usdt_amount_threshold = 100000
        
        for pair in ('NXT/USDT', 'TUSD/USDT', 'GAM/BTC', 'GLD/BTC', 'QRL/ETH', 'XMR/ETH'):
            symbol = tickers.tickers[pair]
            self.assertFalse(Tickers._symbol_allowed(symbol, usdt_rates=usdt_rates, minimum_volume_in_usd=usdt_amount_threshold))

        for pair in ('BTC/USDT', 'XVG/USDT', 'ETH/USDT', 'NBT/BTC', 'POLY/BTC', 'NXS/BTC'):
            symbol = tickers.tickers[pair]
            self.assertTrue(Tickers._symbol_allowed(symbol, usdt_rates=usdt_rates, minimum_volume_in_usd=usdt_amount_threshold))


    def test_tickers_for_symbols_allowed(self):
        tickers = self.poloniex
        self.assertEqual(len(tickers.symbols_info),180)

        # no minimum usd
        tickers = Tickers('poloniex', {'BTC': 8158.02, 'ETH': 524.563, 'USDT': 1.0})
        tickers.tickers = self.poloniex_tickers
        tickers.run()
        self.assertEqual(len(tickers.symbols_info), 180)

        # with minmum usd
        tickers = Tickers('poloniex', {'BTC': 8158.02, 'ETH': 524.563, 'USDT': 1.0}, 50000)
        tickers.tickers = self.poloniex_tickers
        tickers.run()
        self.assertEqual(len(tickers.symbols_info), 118)

        # no minmum usd
        tickers = Tickers('bittrex')
        tickers.tickers = self.bittrex_tickers
        tickers.run()
        self.assertEqual(len(tickers.symbols_info), 540)

        # with minmum usd
        tickers = Tickers('bittrex', {'BTC': 8158.02, 'ETH': 524.563, 'USDT': 1.0}, 50000)
        tickers.tickers = self.bittrex_tickers
        tickers.run()
        self.assertEqual(len(tickers.symbols_info), 354)

        # don't allow transaction currency with lenght > 6
        tickers = self.poloniex
        self.assertTrue(tickers.tickers_has_symbol('Bitmark/BTC'))
        self.assertFalse(tickers.symbols_info_has_symbol('Bitmark/BTC'))

